import React from "react";
import { Link, BrowserRouter as Router } from "react-router-dom";

const Nav = () => {
  return (
    <>
      <Router>
        <Link to="/">Home</Link> <br />

        <Link to="/student">Student</Link><br />

        <Link to="/user">User</Link>
        <Link to="/user">Contact</Link>
      </Router>
    </>
  );
};

export default Nav;
